"Met uw toestemming verzamelt OnePlus gegevens over het gebruik van uw telefoon om het productontwerp en de gebruikerservaring te verbeteren. Als u akkoord gaat met deelname aan het programma voor een betere gebruikerservaring ('programma'), betekent dit dat u ermee instemt dat OnePlus de volgende gegevens mag verzamelen, gebruiken en analyseren: 
 (1) Configuratiegegevens;
 (2) Statistische gegevens van applicatieprogramma's;
 (3) Gegevens over gebruikersgedrag;
 Door het verzamelen en analyseren van de bovenstaande gegevens wil OnePlus de gebruikerservaring verbeteren. Alle procedures worden in anonieme en versleutelde vorm uitgevoerd door OnePlus en kunnen een bijdrage leveren aan het verbeteren van bijvoorbeeld de efficiëntie van de batterij en de systeemstabiliteit. Deze gegevens worden niet gebruikt voor persoonlijke identiteitsherkenning. Nadat u hebt ingestemd met deelname aan het programma, kunt u zich op elk gewenst moment terugtrekken via de volgende methode: ga naar Instelling – Geavanceerd – Programma voor een betere gebruikerservaring en maak de selectie van het vakje ongedaan. Raadpleeg het privacybeleid van OnePlus voor meer informatie over gegevens die door OnePlus worden verwerkt. Zodra u zich terugtrekt uit het programma, stopt OnePlus met het verzamelen van de bovengenoemde gegevens."
